import React, { useState } from "react";
import { Link } from "react-router-dom";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";

export default function NavbarMobile() {
  return (
    <>
      <FontAwesomeIcon
        onClick={() => setMenuDisp(true)}
        icon="fa-solid fa-bars"
      />

      <nav className="navbarMobile">
        <Link className="btnMobile homeMob" to="/">
          Home
        </Link>
        <Link className="btnMobile aboutMob" to="/about">
          About
        </Link>
        <Link className="btnMobile projectsMob" to="/projects">
          Projects
        </Link>
        <Link className="btnMobile contactMob" to="/contact">
          Contact
        </Link>
      </nav>
    </>
  );
}
